import React from 'react'
import { GoogleMap,Marker } from '@react-google-maps/api';

const Map=(props)=>{
    const markers=props.tripArr.map((place)=>{
        <Marker position={{lat:place.lattitude,lng:place.longitude}}/>
    })

    return(
    <GoogleMap zoom={10} center={{lat:props.loc.lattitude,lng:props.loc.longitude}} mapContainerClassName="">
        {markers}
    </GoogleMap>
    )
}

export default Map
